import { StyleSheet, Text, View, TextInput } from 'react-native';
import React from 'react';

const Contact = () => {
  return (
    <View style={styles.mainContainer}>
      <Text style={styles.mainHeader}>Level up your Knowledge</Text>
      <Text style={styles.description}>Musk is the wealthiest person in the world with an estimated </Text>
      <View style={styles.inputContainer}>
      <Text style={styles.lable}>Enter your name</Text>
      <TextInput style={styles.inputStyle} placeholder={"your name"}
        value={{}}
        onChangeText={() => {}}
      />
      </View>

      <View style={styles.inputContainer}>
      <Text style={styles.lable}>Enter your name</Text>
      <TextInput style={styles.inputStyle} placeholder={"your name"}
        value={{}}
        onChangeText={() => {}}
      />
      </View>

      <View style={styles.inputContainer}>
      <Text style={styles.lable}>Enter your email</Text>
      <TextInput style={styles.inputStyle} placeholder={"your email"}
        value={{}}
        onChangeText={() => {}}
      />
      </View>

      <View style={styles.inputContainer}>
      <Text style={styles.lable}>Enter mobile number</Text>
      <TextInput style={styles.inputStyle} placeholder={"mobile number"}
        
        value={{}}
        onChangeText={() => {}}
      />
      </View>

      <View style={styles.inputContainer}>
      <Text style={styles.lable}>Descriptin</Text>
      <TextInput style={[styles.inputStyle, styles.multi]} placeholder={"Tell us about your self..."}
        value={{}}
        onChangeText={() => {}}
      />
      </View>

    </View>
  )
}

const styles = StyleSheet.create({});

export default Contact;
